if mibBuilder.loadTexts: esPointTable.setDescription(" This table organizes 4 basic attributes of points. A point is a particular sensor on an EventSensor (e.g., temperature, humidity, contact closure 2, output 5, etc.). The 4 point attributes are its name, whether it's in its event state, the point's value as a number and its value as a string. Points are referenced by a point index. The point index is a string of 3 numbers separated by periods. It contains all the information necessary for getting a piece of data off an event sensor; namely, which EventSensor, point class, and which-sensor-of-that-class (a.k.a. point). ")
