if mibBuilder.loadTexts: esIndexPC.setDescription('The part of the point index that refers to point class. The point index is a string of 3 numbers separated by periods. It contains all the information necessary for getting a piece of data off an event sensor; namely, which EventSensor, point class, and which-sensor-of-that-class (a.k.a. point). The values for this object are: 1=temperature sensor 2=contact closure 3=humidity sensor 4=noise sensor 5=analog input 6=output (relay output or power output) ')
