if mibBuilder.loadTexts: esIndexPoint.setDescription('The part of the point index that delineates which sensor on the EventSensor. So this combined with esIndexPC (Point Class or type) and esIndexES (which EventSensor) uniquely defines each point (sensor or output) attached to a unit. For example, if esIndexES is 3, esIndexPC is 1 and esIndexPoint is 4 then this is the Fourth Temperature Sensor on EventSensor number 3.')
esPointName = MibTableColumn((1, 3, 6, 1, 4, 1, 3052, 18, 1, 1, 1, 1, 4), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: esPointName.setStatus('current')
if mibBuilder.loadTexts: esPointName.setDescription("The name of the point on an EventSensor. For example, 'AC temp' (in the case of the temperature sensor on an EventSensor). There can be multiple points of the same point class on an EventSensor (e.g., 8 contact closures) and multiple sensor classes on an EventSensor (e.g., temperature, contact closure, humidity). If the point referenced by a given point index is solitary (e.g., temperature sensor, because there can be only one on an EventSensor), then this object reads as '<EventSensor name>'. Setting this object for solitary point indices sets the EventSensor name only. On the other hand, if a given point is among other points of the same point class on an EventSensor, then this object reads as '<Sensor name>'. Setting this object for these NON- solitary point indices sets the sensor name only - not the EventSensor name.")
esPointInEventState = MibTableColumn((1, 3, 6, 1, 4, 1, 3052, 18, 1, 1, 1, 1, 5), Integer32()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: esPointInEventState.setStatus('current')
if mibBuilder.loadTexts: esPointInEventState.setDescription('A number referring to the event state of a point on an EventSensor. This number can have different meanings depending on the point class. If the point class is temperature, humidity, or analog input, then the values of this object are: 1=very low 2=low 3=normal 4=high 5=very high For contact closures the values of this object are: 1=point in event state 2=point in normal state For outputs the values of this object is the numeric code for the logical state of the output: 1 or 2. The logical state of the output is either active/inactive for relay outputs or on/off for power outputs. The logical state of the output has different nomenclature depending on the type of the output (relay output or power output): 1=active (for relay output) or on (for power output) 2=inactive (for relay output) or off (for power output) This is not necessarily representative of physical state of the output. Physical state is energized/de-energized, for both relay and power outputs. For relay outputs, the active logical state corresponds to either the energized physical state or the de-energized physical state depending on how the relay output is configured. For power outputs, the on logical state always corresponds to the energized physical state. For any point class and any point, if the event state is undefined, then the value of this object is 0. For any point class except output, this object is read-only. For outputs, setting this object to 1 puts the output into its active logical state. Setting this object to 2 puts the output into its inactive logical state. Setting this object to any value greater than 2 puts the output into its active logical state for that many seconds (up to 3600), after which time it puts the output into its inactive logical state. ')
esPointValueInt = MibTableColumn((1, 3, 6, 1, 4, 1, 3052, 18, 1, 1, 1, 1, 6), Integer32().subtype(subtypeSpec=ValueRangeConstraint(-2147483648, 2147483647))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: esPointValueInt.setStatus('current')
if mibBuilder.loadTexts: esPointValueInt.setDescription('A read-only number referring to the value of a point on an EventSensor. If the point class is temperature, then this object is the temperature in its configured scale (default is Fahrenheit). If the point class is contact closure, then this object is either 0 (open) or 1 (closed). If the point class is humidity, then this object is the percent relative humidity. If the point class is analog input, then this object is the signed input value in tenths of the configured units. If the point class is an output, then this object is the numeric code for the physical state of the output. 0=de-energized 1=energized This object cannot be used to control the output, i.e, change its logical or physical state (instead use the esPointInEventState object). ')
esPointValueStr = MibTableColumn((1, 3, 6, 1, 4, 1, 3052, 18, 1, 1, 1, 1, 7), DisplayString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: esPointValueStr.setStatus('current')
if mibBuilder.loadTexts: esPointValueStr.setDescription("A string referring to the value of a point on an EventSensor. For contact closures this object is either 'Open' or 'Closed'. For outputs this object is a concatenation of the logical state and physical state, separated by '/'. For a relay output this object can be one of the following 4 possible values: Active/Energized Inactive/Energized Active/De-energized Inactve/De-energized For a power output this object can be one of the following 2 possible values: On/Energized Off/De-energized For temperature and humidity point classes, this object is the string representation of the esPointValueInt object. For temperature, 'C' or 'F' is including in the string to indicate scale. For analog inputs, this object is the string representation of the plus/minus input in the configured units appended with the unit name. ")
